        watch: {
            chats: function () {
                this.scrollToEnd();
            }
        },
        methods: {
            clickChatBoxInitializer() {
                if (this.chatBox.visible) {
                    this.closeChatBox();
                } else {
                    this.chatBoxInitializerDialog.visible = true;
                }
            },
            closeChatBoxInitializerDialog() {
                this.chatBoxInitializerDialog.visible = false;
            },
            openSalesChatBox() {
                this.chatBoxInitializerDialog.visible = false;
                this.chatBox.visible = true;
                this.chatBox.type = 'sales';
            },
            openCloudSupportChatBox() {
                this.chatBoxInitializerDialog.visible = false;
                this.chatBox.visible = true;
                this.chatBox.type = 'cloud-support';
            },
            openSupportOptionsPage() {
                window.open('https://www.oracle.com/support/support-options.htm', '_blank');
            },
            openSalesHoursOfOperationPage() {
                window.open('https://sc-oal-en.custhelp.com/euf/assets/images/sc_hrsof_operation.html', '_blank');
            },
            openCallSalesPage() {
                window.open('https://www.oracle.com/corporate/contact/global.html#', '_blank');
            },
            openChatPrivacy() {

            },
            minimizeChatBox() {
                this.minimizedChatBox = !this.minimizedChatBox;
            },
            closeChatBox() {
                this.chatBox.visible = false;
            },
            sendVerificationCode() {
                this.buttonLoading = true;
                this.currentStep = 1;
                this.buttonLoading = false;

                this.chatBox.otp = Math.floor(1000 + Math.random() * 9000);
                // eslint-disable-next-line no-console
                console.log(this.chatBox.otp);
                //this is where you send phone number to backend, so it will send this phone number an OTP
            },
            verifyCode() {
                this.buttonLoading = true;
                this.currentStep = 2;
                this.buttonLoading = false;
                //this is where the validation code will verify
            },
            sendMessage() {
                if (this.file) {
                    //send file to server and get fileId
                    let fileId = Math.random();
                    let formData = new FormData();
                    formData.append('from', "USER");
                    formData.append('file', this.file);
                    formData.append('message', this.message);
                    formData.append('time', new Date().toLocaleString());
                    this.$axios.post(chatAPIURL,formData)
                        .then((result) => {
                            // eslint-disable-next-line no-console
                            console.log('Success!!');
                            // eslint-disable-next-line no-console
                            console.log(result);
                        })
                        .catch(function(){
                            // eslint-disable-next-line no-console
                            console.log('FAILURE!!');
                        });
                    this.chats.push({
                        from: "User",
                        fileId: fileId,
                        file: this.file.name,
                        message: this.message,
                        time: new Date().toLocaleString(),
                        avatar: 'mdi-account-circle'
                    });
                    this.message = "";
                    this.file = "";
                } else {
                    if (this.message) {
                        let data = {
                            from: "User",
                            message: this.message,
                            time: new Date().toLocaleString(),
                            avatar: 'mdi-account-circle'
                        };
                        //send data to backend
                        this.$axios.post(chatAPIURL,data)
                            .then((result) => {
                                // eslint-disable-next-line no-console
                                console.log('Success!!');
                                // eslint-disable-next-line no-console
                                console.log(result);
                            })
                            .catch(function(){
                                // eslint-disable-next-line no-console
                                console.log('FAILURE!!');
                            });
                        this.chats.push(data);
                        this.message = "";
                    }
                }
            },
            fileChange(file) {
                // eslint-disable-next-line no-console
                console.log(file);
                // eslint-disable-next-line no-console
                console.log(!file);
                this.file = file;
                if (file) {
                    this.message = file.name;
                } else {
                    this.message = '';
                }
            },
            downloadFile(fileId) {
                //download File by fileId
                // eslint-disable-next-line no-console
                console.log(`File ${fileId} downloaded`);
            },
            removeFile() {
                // eslint-disable-next-line no-console
                this.file = null;
                this.message = '';
            },
            scrollToEnd() {
                this.$nextTick(() => {
                    let container = this.$el.querySelector('.chat-container');
                    container.scrollTop = container.scrollHeight
                })
            },
        }
